import React, { useEffect, useState } from 'react';
import '../../App.css';
import './Exams.css';

import Autocomplete from '@material-ui/lab/Autocomplete';
import TextField from '@material-ui/core/TextField';
import CardsExam from '../CardsExam';


export default function Exams() {
  const options = ['Monday', 'Tuesday', 'Thursday',
    'Friday', 'Saturday', 'Sunday']

  const [exams,setExams]=useState([]);

  useEffect(async() => {
       
    
       const data = await fetch('http://localhost:8087/api/exam/getList');
      const dataresult= data.json();
       setExams(dataresult);
  },[]);

  return (
    <div className='content'>
      <h1 >Đề thi</h1>
      <div className='fillter-option'>
        <div className='combobox'>
          <p>
          <Autocomplete
            options={options}
            className='combobox-content'
            renderInput={(params) =>
            <TextField {...params} label="Lớp" variant="outlined" />}
          />
         </p>
         <p>
          <Autocomplete
            options={options}
            className='combobox-content'
            renderInput={(params) =>
              <TextField {...params} label="Môn" variant="outlined" />}
          />
          </p>
        </div>

        <div className='combobox'>
          <p>
          <Autocomplete
            options={options}

            className='combobox-content'
            renderInput={(params) =>
              <TextField {...params} label="Chương" variant="outlined" />}
          />
         </p>
         <p>
          <Autocomplete
            options={options}
            className='combobox-content'
            renderInput={(params) =>
              <TextField {...params} label="Bài" variant="outlined" />}
          />
          </p>
        </div>
           <div>Test la:{exams}</div>   

        <CardsExam></CardsExam>
        
      </div>
      
    </div>
  );
}
